&quot;Finally, a woman on paper!&quot;
With those words, spoken by Alfred Stieglitz on first seeing drawings by Georgia O'Keeffe in 1916, the legendary ronnance and long married partnership of these two artists began. They met when Modernism was taking root in America, pioneered by Stieglitz and his famous gallery 291. In this remarkable double portrait, based upon five years of exhaustive research and access to newly discovered documents, Benita Eisler has recreated this era of promise, as personified by two of Its key figures
